    [],nt"revision_timestamp": "2016-07-27T22:42:04.654603",nt"name": "fg-street-marsh-contaminants-investigation",nt"isopen":
    false,nt"url": null,nt"notes": "F&G Street Marsh, located in San Diego
    Bay National Wildlife Refuge, Chula Vista, San Diego, California, is a tidally influenced
    wetland providing habitat for the endangered light-footed clapper rail, endangered
    salt marsh birdu2019s beak (an estuarine plant), and State of California endangered
    Beldingu2019s savannah sparrow. In addition to the normal influx of water from the
    associated watershed into F&G Street Marsh, it has been documented that Goodrich
    Aerospace Aerostructures Group (Goodrich) has discharged various wastes from its
    adjacent manufacturing operations to soil and ground water in multiple locations
    and the Main Branch stream through Goodrichu2019s Outfall 001. Wastes included chlorinated
    solvents, metals, and fuel hydrocarbons. This study investigates the F&G Street
    Marsh to determine if wastes entering the Main Branch from Outfall 001 are moving
    into the North Branch and adversely affecting the marsh. The results indicated that
    the marsh sediments and biota have a low to low-moderate risk of conditions causing
    acute toxicity to benthic organisms. It was also notable that the most impacted
    locations within F&G Street Marsh were the furthest from Outfall 001. This may be
    because tidal action affects the North Branch and transports sediments and contaminants
    upstream until water hydraulics are suitable for deposition and/or because contaminants
    entering the Main Branch from Outfall 001 continue downstream without moving into
    F&G Street Marsh. No additional study or clean-up is currently suggested by the
    results of this study.",nt"license_title": "License Not Specified",nt"extras":
